import React from 'react';
import { Table } from 'semantic-ui-react';

class StartingStrength extends React.Component {
	render() {
		return (
			<Table>
				<Table.Header>
					<Table.Row>
						<Table.HeaderCell>Week 1</Table.HeaderCell>
						<Table.HeaderCell></Table.HeaderCell>
						<Table.HeaderCell></Table.HeaderCell>
					</Table.Row>
					<Table.Row>
						<Table.HeaderCell>Day A</Table.HeaderCell>
						<Table.HeaderCell>Day B</Table.HeaderCell>
						<Table.HeaderCell>Day A</Table.HeaderCell>
					</Table.Row>
				</Table.Header>

				<Table.Body>
					<Table.Row>
						<Table.Cell>
							Squat
						</Table.Cell>
						<Table.Cell>
							Squat
						</Table.Cell>
						<Table.Cell>
							Squat
						</Table.Cell>
					</Table.Row>
				</Table.Body>
			</Table>
		)
	};
};

export default StartingStrength;
